import '../../data/models/job_model_dto.dart';class JobModel {  JobModel({    this.id,    this.jobName,    this.icon,  });  JobModel.fromJson(dynamic json) {    id = json['id'];    jobName = json['jobName'];    icon = json['icon'];  }  int? id;  String? jobName;  String? icon;  factory JobModel.fromDto(JobModelDto json) {    return JobModel(      id: json.id,      jobName: json.jobName,      icon: json.icon,    );  }}